import React, { useState, useEffect } from "react";

const App = () => {
  const [weather, setWeather] = useState({});

  useEffect(() => {
    const data = fetch(
      "https://samples.openweathermap.org/data/2.5/weather?q=London,uk&appid=439d4b804bc8187953eb36d2a8c26a02"
    )
      .then(res => res.json())
      .then(setWeather());
    console.log(data);
  }, []);

  return <h1></h1>;
};

export default App;
